                            "height": "6' (1.83 m)",
                            "idIMDB": "nm1886602",
                            "name": "Miles Teller",
                            "placeOfBirth": " Downingtown, Pennsylvania, USA",
                            "starSign": "Capricorn",
                            "trivia": [
                                "Graduated from Lecanto High School.",
                                "According to Nicole Kidman, he blushed and quivered during his audition for Rabbit Hole (2010), which got him the part, since \"he was real\".",
                                "His parents are Merry (Flowers) and Mike Teller.",
                                "Miles' paternal grandfather was of Russian Jewish descent, while Miles' paternal grandmother was of Irish and Polish ancestry. Miles' mother's family, which has English and some French lineage, has deep roots in New Jersey.",
                                "Good friends with Shailene Woodley. They co-starred in both The Spectacular Now (2013) and Divergent (2014) and attended the 2013 MTV Video Music Awards (2013) together.",
                                "Originally considered to turn down the lead in Whiplash (2014), because he wished to take a few month off. However, his manager was excited about the script and encouraged Teller to do the film. The movie eventually won the Audience Award and the Grand Jury Prize for the US dramatic category at the 2014 Sundance Film Festival.",
                                "In high school, he was a drummer for a church youth group band.",
                                "He earned a Bachelor of Fine Arts from Tisch School of the Arts at New York University.",
                                "Teller was nominated for the Discovery Award at the Savannah Film Festival for his role as Jason in the 2010 film Rabbit Hole (2010).",
                                "He graduated from Lecanto High School in 2005.",
                                "Teller appeared in the stage musical Footloose (2011). This led to being cast in the film remake of Footloose (2011) starring Kenny Wormald, in which he played the same character as in the stage musical.",
                                "Miles wears a green bracelet that says \"Buckle up for Bo\" in honor of a friend who died in a car crash a year after Miles himself was in a near-fatal car crash. He wears it almost all the time, and has worn it for most of the movies he's been in, except where it doesn't work for the movie.",
                                "His former co-star Nicole Kidman has remained very supportive of his career, after they worked together on Rabbit Hole (2010). Publicly, she has raved about his performances in The Spectacular Now (2013) and Whiplash (2014)."
                            ],
