                            "name": "Paul Reiser",
                            "placeOfBirth": " New York City, New York, USA",
                            "starSign": "Taurus",
                            "trivia": [
                                "Parents are Sam and Helen Reiser.",
                                "Started out doing stand-up comedy.",
                                "Attended and graduated from Stuyvesant High School in New York City in 1973.",
                                "Received his Bachelor's degree from Binghamton University, where her majored in music (piano and composition).",
                                "Paul and his Mad About You (1992) co-star, Helen Hunt, were each given $1,000,000 per episode for the 1999 season.",
                                "Named his production company, Nuance Productions, after a speech his character gives in the comedy movie Diner (1982).",
                                "Son, Ezra Samuel, born September 1995.",
                                "He and his wife, Paula, had a second son: Leon, born in 2000.",
                                "Was considered for the role of Danny Tanner on Full House (1987), but he opted to take the role of Michael Taylor on My Two Dads (1987).",
                                "Best-known by the public for his role as Carter Burke in James Cameron's science-fiction epic Aliens (1986), as well as his starring roles as Michael Taylor in My Two Dads (1987) and as Paul Buchman in Mad About You (1992).",
                                "Recently reunited with Helen Hunt for a Mad About You (1992) reunion. [January 2005]",
                                "Has been spending time with his two sons. [January 2005]"
                            ],
