                            "actorActress": "Actress",
                            "bio": "Melissa Marie Benoist is an American actress and singer known for her portrayal of Marley Rose on season four and the start of season five on the Fox musical comedy-drama television series Glee. Aside from her role on Glee, she has appeared in a number of television series including Homeland, The Good Wife and Law & Order. Benoist's first film was in singer Mariah Carey's Tennessee. She appeared in director Damien Chazelle's film Whiplash (2014), which won top prizes (Grand Jury and Audience awards) at the Sundance Film Festival in Park City, Utah, January 2014.",
