                            "trivia": [
                                "Second cousin of Heather Blair.",
                                "It was at his grandfather Russell (and Russell's brother Abel's) draft into WW2 that they discovered the family surname had been changed from Blarel to Blair when Abel and Russell were young children. His grandfather Russell was thought to be skipping his draft call when they figured out the discrepancy. The surname was changed from the original French in order to sound more English.",
                                "Active in charity work.",
                                "Originally from Michigan.",
                                "He attended L'Anse Creuse High School-North in Macomb Township, Michigan, where he played tennis. After graduating, he made appearance in commercials for Taco Bell, Pizza Hut and Honda Civic."
                            ],
